import React from "react";

function TwoInner() {
  return (
    <div className="f-two-inner">
      <h2 className="f-header-one-inner">Mind Colors</h2> <br />
      <p className="f-text-one-inner">
        Colors on a website have there own industry standards regarding contrast
        and appeal that we follow and create uniquely for your site.
      </p>
    </div>
  );
}

export default TwoInner;
